import React from 'react'
import "./App.css"
import ProductCard from './components/ProductCard'



const App = () => {

  const RandomPrice = () => {
    return (`${Math.round(Math.random() * 1000)}$`)
  }

  let productId = 0;

  const products = [
    {
      title: 'apple',
      price: RandomPrice(),
      imgUrl: 'https://avatars.mds.yandex.net/i?id=1518cd415a3c3c6eb039a336a1f3dff3_sr-5313814-images-thumbs&n=13',
      id: productId++
    }
  ]

  return (
    <div>
      {
        products.map(el => el)
      }


    </div>
  )
}

export default App
